import Axios from "axios";

export const getRoomList = async () => {
  return async (dispatch) => {
    const result = await Axios({
      method: "GET",
      url: "http://localhost:8000/rooms",
    })
      .then((res) => {
        dispatch({
          type: "FETCH_ROOM",
          payload: res.data,
        });
      })
      .catch((err) => {
        console.log("err get room list", err);
      });
  };
};
